import React, {Component} from 'react';
import { BrowserRouter, Switch, Route, Link } from "react-router-dom";

import "./App.css";
import DisplayAllCars from "./components/DisplayAllCars";


export default class App extends Component 
{
    render() 
    {
        return (
                <BrowserRouter>
<div>
    <Link to="/home">Home</Link>
    <Link to="/about">About</Link>
    <Link to="/products">Products</Link>



    <Switch>
        <Route exact path='/products' component={DisplayAllCars}/>
        <Route path='/home' component={() => <h3>homepage coming soon</h3>}/>
        <Route path='/about' component={() => <h3>about page coming soon</h3>}/>
            <Route path="*" component={() => <h3>Invalid URL. Webpage does not exist</h3>}/>
            </Switch>
</div>
                </BrowserRouter>
               )
    }
}
